using System;\nusing System.Collections.Generic;\n\nclass Program\n{\n    static void Main()\n    {\n        // Create a dictionary with Guid as the key\n        Dictionary<Guid, string> dict = new Dictionary<Guid, string>();\n\n        // Add some entries\n        Guid key1 = Guid.NewGuid();\n        Guid key2 = Guid.NewGuid();\n        dict[key1] = "Value1";\n        dict[key2] = "Value2";\n\n        // Access entries\n        if (dict.TryGetValue(key1, out string value1))\n        {\n            Console.WriteLine($"Key: {key1}, Value: {value1}");\n        }\n\n        if (dict.TryGetValue(key2, out string value2))\n        {\n            Console.WriteLine($"Key: {key2}, Value: {value2}");\n        }\n    }\n}